import React, {Component} from 'react';
import Octicon, {getIconByName} from '@primer/octicons-react';


class Enter extends Component{
    constructor(){
        super()
        this.state={
            titulo: "",

        };

        this.handleInput=this.handleInput.bind(this);
    }

    handleInput(e){
        console.log(e.target.value);
        const {value,name}=e.target;
        this.setState({
            [name]:value
        });

    }



    render(){
        return( 
           <div class="container text-white">

               <div class="d-flex p-5 flex-column">

                   <div class="text-center display-1">
                        Game Code
                   </div>

                   <div class="d-flex p-3 mt-5 mb-5 flex-row justify-content-center">


                           <div class="col-md-3">
                               <input
                               type="text"
                               name="gameNumber"
                               className="form-control"
                               placeholder="Introduce tu nombre"
                               onChange={this.handleInput}
                               />
                           </div>

                           <div class="col-md-3 ml-3 span2" >
                               <button type="submit" className="btn btn-primary btn-block">
                                    Unirse al Juego
                               </button>
                           </div>

                   </div>

                   <div class="d-flex p-3 mt-5 flex-row justify-content-center  bn-secondary ">


                           <div class="col-md-3 self-align-baseline">
                               <input
                               type="text"
                               name="gameNumber"
                               className="form-control"
                               placeholder="Introduce tu nombre"
                               onChange={this.handleInput}
                               />
                           </div>

                           <div class="col-md-3 ml-3 span2" >
                                <div class="align-self-center">
                                   <a href='https://github.com'>
                                   <Octicon icon={getIconByName('sign-in')} size='large'/>
                                   </a>
                                </div>
                           </div>

                   </div>
               </div>
           </div>
           );
    }
}

export default Enter
